      <ul>
        {connections.map(connection => (
          <div className='d-flex card card-body bg-white ' style={{"width":"300px"}}>
          <div key={connection._id} className='card card-body bg-white ' style={{"width":"300px"}}><div>{connection.name} </div> <div>{connection.email}</div>
                 <div className='btn bg-white text-success'>Connect</div>
                 </div>
                 </div>

        ))}
      </ul>
    </div>
  );
};

